import React, {
    useState,
    useEffect
} from "react";
import axios from "axios";
import {
    Container,
    TextField,
    Button,
    MenuItem,
    Typography,
    Box,
} from "@mui/material";
import {
    useNavigate
} from "react-router-dom";

const CreateTaskPage = () => {
    const [supportTypes, setSupportTypes] = useState([]);
    const [applications, setApplications] = useState([]);
    const [sqiPics, setSqiPics] = useState([]);
    const [form, setForm] = useState({
        supportTypeId: "",
        customSupportType: "",
        applicationId: "",
        description: "",
        sqiPicId: "",
    });

    const navigate = useNavigate();

    // Fetch data dari backend
    useEffect(() => {
        const fetchData = async () => {
            const [supportRes, appRes, picRes] = await Promise.all([
                axios.get("http://localhost:4000/api/support-types"),
                axios.get("http://localhost:4000/api/applications"),
                axios.get("http://localhost:4000/api/sqi-pics"),
            ]);
            setSupportTypes(supportRes.data);
            setApplications(appRes.data);
            setSqiPics(picRes.data);
        };
        fetchData();
    }, []);

    // Handle input perubahan
    const handleChange = (e) => {
        setForm({
            ...form,
            [e.target.name]: e.target.value
        });
    };

    // Handle submit
    const handleSubmit = async (e) => {
        e.preventDefault();

        const payload = {
            supportTypeId: form.supportTypeId === "other" ? null : form.supportTypeId,
            customSupportType: form.supportTypeId === "other" ? form.customSupportType : null,
            applicationId: form.applicationId,
            description: form.description,
            sqiPicId: form.sqiPicId,
        };

        await axios.post("http://localhost:4000/api/tasks", payload);
        navigate("/");
    };

    return ( <
        Container maxWidth = "sm"
        sx = {
            {
                mt: 5
            }
        } >
        <
        Typography variant = "h5"
        gutterBottom >
        Tambah Task Baru <
        /Typography>



        <
        form onSubmit = {
            handleSubmit
        } >

        <
        TextField fullWidth label = "Judul Task"
        name = "title"
        value = {
            form.title
        }
        onChange = {
            handleChange
        }
        margin = "normal"
        required /
        > {
            /* 1️⃣ Support Type */ } <
        TextField fullWidth label = "Judul Task"
        name = "title"
        value = {
            form.title
        }
        onChange = {
            handleChange
        }
        margin = "normal"
        required /
        >

        <
        TextField select fullWidth label = "Bentuk Support"
        name = "supportTypeId"
        value = {
            form.supportTypeId
        }
        onChange = {
            handleChange
        }
        margin = "normal"
        required >
        {
            supportTypes.map((type) => ( <
                MenuItem key = {
                    type.id
                }
                value = {
                    type.id
                } > {
                    type.name
                } <
                /MenuItem>
            ))
        } <
        MenuItem value = "other" > Other < /MenuItem> <
        /TextField>

        {
            /* 1b️⃣ Custom support type kalau pilih “Other” */ } {
            form.supportTypeId === "other" && ( <
                TextField fullWidth label = "Custom Support Type"
                name = "customSupportType"
                value = {
                    form.customSupportType
                }
                onChange = {
                    handleChange
                }
                margin = "normal"
                required /
                >
            )
        }

        {
            /* 2️⃣ Aplikasi */ } <
        TextField select fullWidth label = "Aplikasi"
        name = "applicationId"
        value = {
            form.applicationId
        }
        onChange = {
            handleChange
        }
        margin = "normal"
        required >
        {
            applications.map((app) => ( <
                MenuItem key = {
                    app.id
                }
                value = {
                    app.id
                } > {
                    app.name
                } <
                /MenuItem>
            ))
        } <
        /TextField>

        {
            /* 3️⃣ Deskripsi */ } <
        TextField fullWidth label = "Deskripsi"
        name = "description"
        value = {
            form.description
        }
        onChange = {
            handleChange
        }
        margin = "normal"
        multiline rows = {
            3
        }
        required /
        >

        {
            /* 4️⃣ PIC SQI */ } <
        TextField select fullWidth label = "PIC SQI"
        name = "sqiPicId"
        value = {
            form.sqiPicId
        }
        onChange = {
            handleChange
        }
        margin = "normal"
        required >
        {
            sqiPics.map((pic) => ( <
                MenuItem key = {
                    pic.id
                }
                value = {
                    pic.id
                } > {
                    pic.name
                } <
                /MenuItem>
            ))
        } <
        /TextField>

        <
        Box sx = {
            {
                textAlign: "right"
            }
        } >
        <
        Button type = "submit"
        variant = "contained"
        color = "primary"
        sx = {
            {
                mt: 3
            }
        } >
        Simpan Task <
        /Button> <
        /Box> <
        /form> <
        /Container>
    );
};

export default CreateTaskPage;
